import './index.css'

import React, { Component } from 'react'

export default class Fave extends Component {
    render() {

        var names = this.props.data.map(element =>{
            return <Names name={element.name} handelEventSelect={this.props.handelEventSelect} element={element}/>
        })

        return (
            <div className="film-row-fave add_to_queue">
               <p className="material-icons">add_to_queue</p>
            </div>
        )
    }
}
